export default function UsersList(){

    const [data, setData] = useState(props.data);

    return(
        <View>
        <FlatList
                style={styles.items}
                data={data}
                renderItem={({ item }) => (
                    <View>
                        <Text>{item.username}</Text>
                        <Delete token={props.token} id={item.id} deleteTodo={props.delete} choix={"user"} />
                        </View>
                )}
            />
        </View>
    )
}
